    columns = {}
    for (x, y) in points:
        if x in columns:
            columns[x] = []
        columns[x].append(y)
    last = {}
    ans = float('inf')
    for x in sorted(columns):
        column = columns[x]
        column.sort()
        for (j, y2) in enumerate(column):
            for i in range(j):
                y1 = column[i]
                if (x, y1, y2) in last:
                    for (x1, y3) in last[x, y1, y2]:
                        ans = min(ans, ((x - x1) ** 2 + (y2 - y3) ** 2) ** 0.5 * (y2 - y1))
